<script>
        const canvas = document.getElementById('static');
        const ctx = canvas.getContext('2d');
        const flash = document.getElementById('flash');
        const svgContainer = document.getElementById('svg-container');

        canvas.width = window.innerWidth;
        canvas.height = window.innerHeight;

        function generateNoise() {
            const imageData = ctx.createImageData(canvas.width, canvas.height);
            const data = imageData.data;
            for (let i = 0; i < data.length; i += 4) {
                const color = Math.random() * 255;
                data[i] = data[i + 1] = data[i + 2] = color;
                data[i + 3] = 255;
            }
            ctx.putImageData(imageData, 0, 0);
        }

        function noiseLoop() {
            generateNoise();
            requestAnimationFrame(noiseLoop);
        }
        noiseLoop();

            const urlParams = new URLSearchParams(window.location.search);

    </script>

<script>
function getQueryParam(name) {
    const urlParams = new URLSearchParams(window.location.search);
    return urlParams.get(name);
}

window.onload = function() {
    const id1 = getQueryParam('ident1');
    const id2 = getQueryParam('ident2');
    const t1 = document.getElementById('ident1');
    const t2 = document.getElementById('ident2');
    if (id1 && t1) t1.textContent = id1;
    if (id2 && t2) t2.textContent = id2;

    const svgContainer = document.getElementById('svg-container');
    const flash = document.getElementById('flash');
    const canvas = document.getElementById('static');

    setTimeout(() => {
        if (svgContainer) svgContainer.style.opacity = 1;
        if (flash) flash.style.opacity = 1;
        setTimeout(() => {
            if (flash) flash.style.opacity = 0;
            if (canvas) canvas.style.opacity = 0;
        }, 200);
    }, 5000);
};
</script>
</body>
</html>
